INSERT INTO `beritas` VALUES (1, 'HIMPSI Memenuhi Undangan KBRI Brunei Darussalam untuk Pemeriksaan Psikologis WNI yang Terjerat Kasus Hukum di Brunei Darussalam', 'sukseskan-ssgi-2024', '26 November 2023, Ketua Umum HIMPSI (Dr. Andik Matulessy, M.Si., Psikolog), Ketua III PP HIMPSI (Dra. Reni Kusumowardhani, M.Psi., Psikolog) dan Wakil Sekretaris Jendral PP HIMPSI (Dr. Naomi Soetikno, M.Pd., Psikolog) tiba di Brunei Darussalam.\r\n\r\nDalam kunjungan ini, HIMPSI melakukan pemeriksaan psikologis bagi WNI yang tengah menghadapi kasus hukum di Brunei Darussalam.\r\n\r\nLayanan Psikologi untuk Pekerja Migran Indonesia:\r\nSelain itu, HIMPSI juga juga turut memberikan Layanan Psikologi bagi Pekerja Migran Indonesia di shelter Kedubes Brunei.\r\n\r\nPemenuhan undangan ini adalah bentuk nyata dukungan HIMPSI terhadap negara, meneguhkan komitmen untuk hadir memberi dukungan kepada warga negara Indonesia.\r\n\r\nLangkah ini tidak berhenti pada satu momen.\r\n\r\nKetua Umum HIMPSI dan Wakil Kepala Perwakilan Kedubes RI Bandar Seri Begawan (Drs. Irwan Iding, M.Si.) menandatangani kerja sama untuk program-program ke depannya yang membawa manfaat bagi warga negara Indonesia.\r\n\r\nBersama-sama, mari kita perjuangkan kesejahteraan mental dan mendukung setiap langkah positif menuju masa depan yang lebih baik', 3, '1728814561_Sukseskan-SSGI-2024.jpg', '0', 1, '2024-09-28 12:04:24', '2024-11-06 04:27:18');
INSERT INTO `beritas` VALUES (2, 'HIMPSI dan KBRI Bandar Seri Begawan (Brunei Darussalam) Tandatangani MoU Kerja Sama Lindungi Pekerja Migran Indonesia', 'laporan-akhir-pelaksanaan-program-investing-in-nutrition-and-early-years-iney-dalam-mendukung-percepatan-penurunan-stunting-2018-2023', 'Lanjutan dari undangan KBRI BSB kepada HIMPSI untuk memberikan layanan psikologis bagi Pekerja Migran Indonesia (PMI) yang berada di shelter KBRI. HIMPSI dan KBRI BSB sepakat untuk berkolaborasi memberi perlindungan bagi PMI di Brunei Darussalam.\r\n\r\nKetua Umum HIMPSI dan Wakil Kepala Perwakilan Kedubes RI Bandar Seri Begawan (Drs. Irwan Iding, M.Si.) menandatangani kerja sama ini pada tanggal 27 November 2023.\r\n\r\nPelindungan yang dimaksud yaitu pemberian layanan psikologi preventif, promotif, kuratif, rehabilatif, dan paliatif untuk meningkatkan kesehatan psikologis PMI.\r\n\r\n\"Jumlah WNI, termasuk PMI yang tercatat di KBRI BSB saat ini mencapai sekitar 30.000 orang, namun apabila dimasukkan dengan jumlah mereka yang belum tercatat (belum lapor diri ke KBRI) diperkirakan mencapai 50.000 orang, sementara jumlah total penduduk Brunei sendiri sekitar 460.000 orang.\"\r\n\r\nKerja sama ini merupakan implementasi amanat UU No. 18 / 2017 tentang Pelindungan Pekerja Migran Indonesia, yaitu negara memberi pelindungan kepada WNI yang berada di luar negeri. Juga merupakan implementasi amanat UU Nomor 23 / 2022 tentang Pendidikan dan Layanan Psikologi bahwa layanan psikologi bertujuan antara lain untuk memberikan pelindungan kepada masyarakat.\r\n\r\nPada Kesempatan tersebut, Dubes Ubaedillah juga menyampaikan ucapan terima kasih kepada Dr. Andik Matulessy, M.Si., Ketua Umum HIMPSI dan Tim atas bantuan konsultasi psikologis, termasuk bagi PMI yang berada di shelter KBRI BSB.\r\n\r\nKerja sama KBRI BSB dan HIMPSI secara nyata bermanfaat bagi PMI di Brunei, antara lain melatih kesiapan psikologis dalam menghadapi situasi baru (terutama penyesuaian diri dan daya tahan stress) dan meningkatkan kemampuan self care dalam menghadapi masalah.', 3, '1728814643_2024_AGP_Rakernas_Thumbnail-01-copy.png', '0', 1, '2024-10-12 02:40:59', '2024-11-06 04:28:34');
INSERT INTO `beritas` VALUES (3, 'IUPSYS WORK GROUPS - CALL FOR NOMINATIONS', 'buka-rakornas-percepatan-penurunan-stunting-2024-wapres-harap-pemerintahan-selanjutnya-lampaui-target-lebih-baik', 'IUPSYS WORK GROUPS - CALL FOR NOMINATIONS\r\n\r\n \r\n\r\nThe International Union of Psychological Science (IUPsyS), the global voice of psychology, hereby issues a Call for Nominations from National Members, Regional Members and Affiliates for the following Work Groups:\r\n\r\n \r\n\r\nCross-border Psychology Services\r\n\r\nEquality in Science\r\n\r\nGlobal Psychology Lecture Series and Events\r\n\r\nInternational Congresses of Psychology\r\n\r\nLicensure and Regulation\r\n\r\nIUPsyS Response to Crises\r\n\r\n \r\n\r\nIUPsyS welcomes nominations from National, Regional, and Affiliate Members for Work Groups whose membership will represent the breadth, depth and diversity of the IUPsyS membership. IUPsyS encourages Nominees to review the 2020-2024 Strategic Plan to become familiar with the larger context in which their expertise and interests will contribute to IUPsyS’ mission. The draft Terms of Reference for the Work Groups are available online for further information.\r\n\r\n \r\n\r\nNominee Criteria\r\n\r\nIn order to be selected, Nominees shall commit to serving a full term (July, 2026). Nominees, if appointed, agree to dedicate the time necessary to fulfil their responsibilities to the Work Group including, but not limited to, attendance at meetings and the submission of reports to the IUPsyS Officers. Work Group Members are also required to sign the IUPsyS Confidentiality and Conflict of Interest Declaration.\r\n\r\n \r\n\r\nNomination Process and Submission Materials\r\n\r\nAuthorised representatives from IUPsyS National Members, Regional Members and International Affiliates may nominate representatives for IUPsyS Work Groups. Only one nomination for each Work Group is allowed per Membership Organisation. Each nomination must include the following:\r\n\r\n \r\n\r\nNomination Form (available online)\r\n\r\nA cover letter by the Nominee (not exceeding one page) addressing their specific experiences and skills relevant to the position and motivation to serve on the Work Group.\r\n\r\nA one-page curriculum vitae of the Nominee.\r\n\r\nA signed statement expressing the Nominee’s agreement to be nominated and to serve if elected.\r\n\r\n \r\n\r\nNominations are to be submitted by email to Ashley Van Heerden, IUPsyS Administrative Officer (admin.officer@iupsys.org), by February 02, 2024. All enquiries about nominations should be directed the IUPsyS Secretariat (secretariat@iupsys.org).\r\n\r\n \r\n\r\nSelection Process\r\n\r\n \r\n\r\nNominees will be appointed to the Work Group by IUPsyS Executive Committee based on experience, expertise and diversity considerations, including geographic representation. Successful nominees will be notified by March 29, 2024', 3, '1728814729_Rakornas-Percepatan-Penurunan-Stunting-2024.webp', '0', 1, '2024-10-13 10:14:04', '2024-11-06 04:30:39');
INSERT INTO `beritas` VALUES (4, 'CALL FOR EXPRESSIONS OF INTEREST IUPSYS PUBLICATIONS REVIEW COMMITTEE', 'buka-rakornas-stunting-wapres-ungkap-keberhasilan-pemerintah-turunkan-prevalensi-lima-tahun-terakhir', 'CALL FOR EXPRESSIONS OF INTEREST\r\n\r\nIUPSYS PUBLICATIONS REVIEW COMMITTEE\r\n\r\n \r\n\r\nThe mission of the International Union of Psychological Science (IUPsyS) is to develop, represent and advance psychology as a basic and applied science nationally, regionally, and internationally. Publications have a central role in the Union achieving its mission and IUPsyS currently publishes the prestigious International Journal of Psychology and has a long history of seminal publications that have influenced the growth and development of psychology globally.\r\n\r\n \r\n\r\nThe main outcome of the review will be the development of a strategic plan for publishing that meets the Union’s mission. The Publications Review process is expected to involve approximately 12-18 months and will include external experts and representatives from our Publishers. Meetings will be held virtually on a quarterly basis, with opportunities for asynchronous engagement.\r\n\r\n \r\n\r\nWe are therefore seeking expressions of interest from individuals from our National and Regional Members to serve on the Publications Review Committee. We are particularly seeking individuals with a strong record of psychological science scholarship and\r\n\r\n \r\n\r\nExperience in:\r\n\r\ndifferent forms of dissemination including social media\r\n\r\nunderstanding of scientific and practitioner publication activities\r\n\r\nworking with Learned Societies especially international organisations on dissemination of science and practice in psychology\r\n\r\nmulti agency/cross disciplinary publication and dissemination\r\n\r\n \r\n\r\nCommitment to:\r\n\r\ndiversity and global representation in psychological dissemination\r\n\r\nscientists and practitioners from all parts of the globe being supported to engage equally with open science as both recipients and contributors\r\n\r\nexploring the future of psychological science publications\r\n\r\n \r\n\r\nThese positions are voluntary. Those expressing interest should not be currently working in competing capacity and are required to sign the IUPsyS Confidentiality and Conflict of Interest Declaration.\r\n\r\n \r\n\r\nIn the first instance, expressions of interest should comprise of:\r\n\r\n \r\n\r\na one-page statement to include full name, position and a summary of relevant experience\r\n\r\none page supporting letter from an IUPsyS National or Regional Member stating the individual has the support of the National or Regional Member. This should be from a person authorised by the National or Regional Member to write such a letter and the letter should state that this was the case.\r\n\r\n \r\n\r\nTo express interest please submit the following to admin.officer@iupsys.org by January 29, 2024. Informal queries may be made to the Chair of IUPsyS Standing Committee for Publications, Professor Pam Maras, by emailing publications@iupsys.org before the deadline for Expressions of Interest.', 3, '1728814807_Buka-Rakornas-Stunting-Wapres-Ungkap-Keberhasilan-Pemerintah-Turunkan-Prevalensi-Lima-Tahun-Terakhir.webp', '0', 1, '2024-10-13 10:20:07', '2024-11-06 04:29:52');
INSERT INTO `beritas` VALUES (5, 'INTERNATIONAL JOURNAL OF PSYCHOLOGY CALL FOR EXPRESSIONS OF INTEREST FOR EDITOR-IN-CHIEF', 'rakornas-percepatan-penurunan-stunting-2024-bahas-berbagai-hal-mulai-dari-refleksi-hingga-luncurkan-layanan-digital-e-assistance-for-stunting-information', 'International Journal of Psychology\r\n\r\nCall for Expressions of Interest for Editor-in-Chief\r\n\r\n \r\n\r\nExpressions of Interest are being invited for a new Editor-in-Chief of the International Journal of Psychology (IJP), as the current Editor-in-Chief Professor Abigail Gewirtz’s term will end December 2024. The contract will be for a four-year period, commencing January 01, 2025, with the possibility of renewal. The incoming Editor-in-Chief will have a six-month transition period (July 01 - December 31, 2024) to allow for an orderly transfer of editorial functions and the maintenance of the production schedule.\r\n\r\n \r\n\r\nThe International Journal of Psychology is the official journal of the International Union of Psychological Science (IUPsyS) and is published by Wiley Publishing, Oxford, UK. Under Professor Gewirtz’s outstanding leadership, IJP’s profile, including the impact factor, has risen significantly. IUPsyS envisions a talented, highly motivated person with experience to continue on this upward trajectory.\r\n\r\n \r\n\r\nThe International Journal of Psychology seeks to advance psychological research of interest and relevance for the human condition around the world, and to serve as the outlet for internationally relevant basic and applied research in scientific psychology. The International Journal of Psychology publishes six issues per year (and additional special issues). The journal is one of the oldest peer-reviewed journals in psychological science and the only truly multidisciplinary, international psychology journal. Last year, IJP received submissions from authors in more than 80 countries from around the world. High quality articles that address timely psychological issues of international relevance to a broad readership from scholars around the world are encouraged.\r\n\r\n \r\n\r\nThe International Journal of Psychology will be published in an online-only format effective with the 2024 volume. This is a proactive move towards reducing the environmental impact caused by the production and distribution of printed journal copies and will allow the journal to invest in further innovation, digital development and sustainability measures.\r\n\r\n \r\n\r\nThe International Journal of Psychology’s impact factor is 3.2 (2022), placing it in the second quartile of general psychology journals. For further information on IJP, see this letter from the Editor-in-Chief. There are currently three Associate Editors for IJP. The Editor-in-Chief currently receives an honorarium of USD15,000 per annum, as well as support for office expenses.\r\n\r\n \r\n\r\nThe Editor-in-Chief determines the contents of the six regular issues and provides consultancy on special issues. The Editor-in-Chief is expected to appreciate and value the diverse and international nature of our field and the global psychology organisation that IJP represents. The Editor-in-Chief is tasked with recruiting and maintaining an editorial team (Associate Editors).\r\n\r\n\r\nIn addition, the Editor-in-Chief is expected to attend online quarterly meetings of the IUPsyS Standing Committee on Publications and attend the annual IUPsyS Executive Committee meeting to provide a written report on the journal. The Editor-in-Chief candidate should meet all or most of the following criteria:\r\n\r\nbe a recognised leader in psychological science with outreach and visibility within the scientific community;\r\n\r\nhave a wide-ranging knowledge of and broad perspective on international psychological science, basic and applied, including new scientific perspectives from allied fields, especially areas of research that integrate different aspects of scientific thinking;\r\n\r\nhave proven skills in planning and conducting research, scientific writing, reviewing for scientific journals, and management;\r\n\r\nhave a high level of English language competence;\r\n\r\nbe able to devote the time necessary to fulfil all editorial duties in a timely fashion, including overseeing the editorial team and managers, and liaising with the publisher over a variety of issues; and\r\n\r\nhave experience of publishing in IJP (preferred but not required);\r\n\r\n \r\n\r\n \r\n\r\nTo express interest in the Editor-in-Chief of IJP, please submit the following to admin.officer@iupsys.org by January 15, 2024. Informal queries may be made to the Chair of IUPsyS Standing Committee for Publications, Professor Pam Maras, by emailing publications@iupsys.org before the deadline for Expressions of Interest.\r\n\r\n \r\n\r\nExpressions of Interest should include:\r\n\r\n \r\n\r\nA cover letter (two-page maximum) with the following:\r\n\r\n- A vision statement for IJP\r\n- Overall direction (i.e., short, medium and long-term plans) for IJP if appointed;\r\n- Relevant expertise and anticipated unique contributions to IJP;\r\n\r\nA short Curriculum Vitae (3 pages maximum); and\r\n\r\nA letter confirming membership in an IUPsyS National Member.\r\n\r\n \r\n\r\nShort listed individuals will be asked to provide letters of support on their suitability. Brief interviews may be conducted in April 2024.', 3, '1728814851_Rakornas-Percepatan-Penurunan-Stunting-2024-Bahas-Berbagai-Hal-Mulai-dari-Refleksi-Hingga-Luncurkan-Layanan-Digital-E-Assistance-for-Stunting-Information.webp', '0', 1, '2024-10-13 10:20:51', '2024-11-06 04:30:27');
INSERT INTO `beritas` VALUES (6, 'Daftar Kerja Sama HIMPSI dengan Lembaga Pemerintah, Non-Pemerintah, hingga Perguruan Tinggi', 'apresiasi-penanganan-stunting-di-daerah-wapres-serahkan-simbolis-dana-insentif-fiskal-pada-20-kepala-daerah', 'Himpunan Psikologi Indonesia (HIMPSI) merupakan induk organisasi profesi psikologi yang memiliki peran krusial dalam mengembangkan, mendukung, dan memajukan dunia psikologi di Indonesia. Dalam menjalankan misinya, HIMPSI menjalin kerja sama strategis dengan berbagai lembaga, pemerintah, penyelenggara pendidikan, dan entitas lainnya. Kerja sama ini tidak hanya mendukung perkembangan profesi psikologi, tetapi juga berkontribusi pada pemahaman dan pengembangan masyarakat terhadap psikologi sebagai ilmu pengetahuan yang penting. Berikut adalah beberapa bentuk kerja sama HIMPSI dengan berbagai pihak:\r\n\r\n\r\nNota Kesepakatan Kerja Sama dengan Lembaga Pemerintah:\r\n\r\n1.      Lembaga Perlindungan Saksi dan Korban (Layanan Psikologis di Lingkungan Lembaga Perlindungan Saksi dan Korban)\r\n\r\n2.      Badan Nasional Penanggulangan Terorisme Deputi Bidang Pencegahan, Perlindungan dan Deradikalisasi (Penanggulangan Terorisme Pada Masyarakat)\r\n\r\n3.      Komisi Pemilihan Umum RI (Dukungan Pelayanan Pdikologi Dalam Penyelenggaraan Pemilihan Umum dan Pemilihan Gubernur, Bupati, dan Walikota)\r\n\r\n4.      Kedubes Brunei Darussalam (Peningkatan Upaya Perlindungan bagi Pekerja Migran Indonesia melalui Program Layanan Psikologi)\r\n\r\n \r\n\r\nNota Kesepakatan Kerja Sama dengan Lembaga Non-Pemerintah\r\n\r\n1.      Indonesia Career Center Network\r\n\r\n2.      Wahana Visi Indonesia (Kerjasama Tenaga Ahli Dalam Upaya Mewujudkan Kesejahteraan Anak dan Masyarakat)\r\n\r\n3.      PT Sanubari Senantiasa Sejahtera (KALM) (Bantuan Himpunan Psikologi Indonesia dalam mendukung KALM sebagai penyedia jasa layanan kesehatan mental secara daring)\r\n\r\n4.      Perhimpunan Organisasi Pasien TB Indonesia (POP TB Indonesia) (Bantuan Himpunan Psikologi Indonesia dalam Rujukan Layanan Bantuan Psikologis Awal Oleh Responder Hotline Kesehatan Mental Bagi Pasien TBC)\r\n\r\n5.      Dompet Dhuafa (DD) (Kolaborasi Layanan Psikologis Bagi Penyintas Bencana)\r\n\r\n \r\n\r\nPerjanjian Kerja Sama dengan Pemerintah:\r\n\r\n1.      Kepolisian Negara Republik Indonesia (Pelaksanaan Bantuan Pengembangan Kapasitas Sumber Daya Manusia Dalam Rangka Peningkatan Profesionalisme)\r\n\r\n2.      Direktorat Jenderal Pembinaan Penempatan Tenaga Kerja Dan Perluasan Kesempatan Kerja Kementerian Ketenagakerjaan (Pemanfaatan Layanan Psikologi Dalam Penguatan Pelayanan Penempatan Tenaga Kerja)\r\n\r\n3.      Deputi Bidang Pemantapan Nilai-nilai Kebangsaan Lembaga Ketahanan Nasional Republik Indonesia (LEMHANNAS RI) (Penyelenggaraan Pemantapan Nilai-nilai Kebangsaan Bagi Himpunan Psikologi Indonesia (HIMPSI))\r\n\r\n4.      Emotional Health For All Foundation (EHFA)\r\n\r\n5.      Badan Pelindungan Pekerja Migran Indonesia (BP2MI) (Layanan Psikologi Bagi Calon Pekerja Migran Indonesia yang Ditempatkan oleh Badan Pelindungan Pekerja Migran Indonesia Ke Negara Jerman)\r\n\r\n6.      Kementerian Pemberdayaan Perempuan Dan Perlindungan Anak\r\nRepublik Indonesia (Layanan Psikologi Dalam Kegiatan Pemberdayaan Perempuan dan Perlindungan Anak)\r\n\r\n \r\n\r\nNota Kesepakatan Kerja Sama dengan Universitas:\r\n\r\n1.      Universitas Muhammadiyah Gorontalo (Penyelenggaraan Pendidikan, Penelitian dan Pengabdian Kepada Masyarakat)\r\n\r\n2.      Universitas Pembangunan Jaya (Pengembangan Kegiatan Kerja sama di Bidang Pendidikan, Pelatihan, dan Serifikasi Profesi)\r\n\r\n3.      Universitas Udayana (Memberi dasar memanfaatkan kemampuan masing-masing pihak melaksanakan ruang lingkup kerjasama sebagai bentuk pelaksanaan Tri Dharma Perguruan Tinggi)\r\n\r\n4.      Universitas Padjadjaran (Kerjasama Pengembangan Keilmuan Psikologi dan Pengabdian Kepada Masyarakat)\r\n\r\n5.      Universitas Bhayangkara Jakarta Raya (Mengembangkan Kegiatan Kerjasama di Bidang Pendidikan, Pelatihan, Sertifikasi Profesi dan Pengabdian Masyarakat)\r\n\r\n6.      Universitas 17 Agustus 1945 Surabaya (Pendidikan, Penelitian, dan Pengabdian Kepada Masyarakat)\r\n\r\n7.      Universitas Sumatera Utara (Pendidikan, Penelitian, dan Pengabdian Kepada Masyarakat)\r\n\r\n8.      Universitas Pancasila (Kerja sama di bidang Pendidikan, Pelatihan, dan Sertifikasi Profesi)\r\n\r\n9.      Universitas Khairun (Bantuan Himpunan Psikologi Indonesia Dalam Pelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n10.  Universitas Mercu Buana Yogyakarta (UMBY) (Bantuan Himpunan Psikologi Indonesia Dalam Pelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n11.  Universitas Muhammadiyah Maluku Utara (UMMU) (Bantuan Himpunan Psikologi Indonesia Dalam Pelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n12.  Universitas Mercu Buana (Bantuan Himpunan Psikologi Indonesia Dalam Pelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n13.  Universitas Jenderal Achmad Yani (Bantuan Himpunan Psikologi Indonesia Dalam Pelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n14.  Universitas Tarumanagara (Bantuan Himpunan Psikologi Indonesia Dalam Pelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n15.  Universitas Islam 45 (UNISMA) Bekasi (Penerapan Tri Dharma Perguruan Tinggi)\r\n\r\n16.  Universitas Negeri Malang (Pengembangan Pendidikan, Penelitian, Pengabdian Kepada Masyarakat, Peningkatan Sumber Daya Manusia dan Tata Kelola)\r\n\r\n17.  Universitas Islam Negeri (UIN) Syarif Hidayatullah Jakarta (Pelaksanaan Tri Darma Perguruan Tinggi, Pengembangan Keilmuan Psikologi dan Sumber Daya Manusia)\r\n\r\n18.  Universitas Pancasila (Bantuan Himpunan Psikologi Indonesia dalam Pelaksanaan Tridharma Perguruan Tinggi dan Pengembangan Keilmuan Psikologi)\r\n\r\n19.  Universitas Katolik Soegijapranata\r\n\r\n20.  Universitas Islam Indonesia (Pelaksanaan Tri Dharma Perguruan Tinggi, Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n21.  Universitas Sanata Dharma (Bantuan Himpunan Psikologi Indonesia Dalam\r\nPelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n22.  Universitas Islam Negeri Sunan Ampel Surabaya (Pelaksanaan Tri Dharma Perguruan Tinggi, Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n \r\n\r\nPerjanjian Kerja Sama dengan Universitas:\r\n\r\n1.      Jaya Center For Advanced Learning\r\n\r\n2.      Universitas YARSI (Kerja Sama Mengembangkan Keilmuan dan Keanggotaan HIMPSI)\r\n\r\n3.      Fakultas Psikologi Universitas Padjadjaran (Kerja Sama Pengembangan Keilmuan Psikologi dan Pengabdian Kepada Masyarakat)\r\n\r\n4.      Lembaga Sertifikasi Profesi P1 UBHARA JAYA\r\n\r\n5.      Fakultas Psikologi Universitas Sumatera Utara (Pelaksanaan Tri Dharma Perguruan Tinggi dan Keanggotaan HIMPSI)\r\n\r\n6.      Lembaga Sertifikasi Profesi Universitas Pancasila\r\n\r\n7.      Fakultas Psikologi Universitas Mercu Buana Yogyakarta (Pengembangan Ilmu dan Profesi Psikologi Serta Pengetahuan dan Keterampilan Ilmuwan Psikologi dan Psikolog)\r\n\r\n8.      HIMPSI Wilayah Maluku Utara - Fakultas Kedokteran Universitas Khairun Ternate (Pengembangan Ilmu dan Profesi Psikologi Serta Pengetahuan dan Keterampilan Ilmuwan Psikologi dan Psikolog)\r\n\r\n9.      Fakultas Psikologi Universitas Mercu Buana (Pengembangan Ilmu Dan Profesi Psikologi Serta Pengetahuan Dan Keterampilan Ilmuwan Psikologi dan Psikolog)\r\n\r\n10.  Fakultas Psikologi Universitas Jenderal Achmad Yani (Pengembangan Ilmu Dan Profesi Psikologi Serta Pengetahuan Dan Keterampilan Ilmuwan Psikologi dan Psikolog)\r\n\r\n11.  Fakultas Ilmu Sosial Dan Ilmu Politik Universitas Islam 45 Bekasi (Pengembangan Ilmu Dan Profesi Psikologi Serta Pengetahuan Dan Keterampilan Ilmuwan Psikologi Dan Psikolog)\r\n\r\n12.  Universitas Negeri Malang (Pelaksanaan Tri Darma Perguruan Tinggi Serta Pengembangan Keilmuan Psikologi Dan Sumber Daya Manusia)\r\n\r\n13.  Fakultas Psikologi Universitas Islam Negeri (UIN) Syarif Hidayatullah Jakarta (Pengembangan Ilmu Dan Profesi Psikologi Serta Pengetahuan Dan Keterampilan Ilmuwan Psikologi Dan Psikolog)\r\n\r\n14.  Fakultas Psikologi Universitas Pancasila (Pelaksanaan Tri Dharma Perguruan tinggi Serta Pengembangan Keilmuan Psikologi)\r\n\r\n15.  Fakultas Psikologi Universitas Sanata Dharma (Pengembangan Ilmu Dan Profesi Psikologi Serta Pengetahuan Dan Keterampilan Ilmuwan Psikologi Dan Psikolog)\r\n\r\n16.  Fakultas Psikologi Dan Kesehatan Universitas Islam Negeri Sunan Ampel Surabaya (Pengembangan Ilmu Dan Profesi Psikologi Serta Pengetahuan\r\nDan Keterampilan Ilmuwan Psikologi Dan Psikolog)\r\n\r\n17.  Fakultas Psikologi Universitas Islam Negeri Sunan Gunung Djati Bandung (Pengembangan Ilmu Dan Profesi Psikologi Serta Pengetahuan Dan Keterampilan Ilmuwan Psikologi Dan Psikolog )', 3, '1728814889_Apresiasi-Penanganan-Stunting-di-Daerah-Wapres-Serahkan-Simbolis-Dana-Insentif-Fiskal-pada-20-Kepala-Daerah.webp', '0', 1, '2024-10-13 10:21:29', '2024-11-06 04:32:11');
